import React from 'react'
import Navbar from './components/Navbar'
import {Switch,Route} from 'react-router-dom';
import Resume from './components/Resume';


const App = () => {
    return (
        <div>
            <Navbar />
            <Resume />
            
                <Route path="/" component={App}/>
                <Route path="/resume" component={Resume}/>
           
        </div>
    )
}

export default App
